essentials/getting-started.html.body:
Erste SchritteHinweis: Wir benutzen ES2015 in den Code-Beispielen.Eine Single-Page-Applikation mit Vue.js und vue-router zu erstellen ist wirklich simpel. Mit Vue.js stellen wir unsere App ja bereits aus Komponenenten zusammen. Wenn wir nun vue-router ins Spiel bringen, m√ºssen wir lediglich unsere Komponenenten den "Routes" zuordnen und vue-router mitteilen, wo diese Komponenenten gerendert werden sollen. Hier ein einfaches Beispiel:Alle Beispiele nutzen die Standalone-Version von Vue, um Template-Parsing nutzen zu k√∂nnen. Mehr Details hier (englisch)HTML



  Hello App!

     zur Navigation -->

     wird standardm√§√üig als  gerendert-->
    Go to Foo
    Go to Bar





JavaScript// 0. Wenn du Module-System wie Webpack oder Browserify benutzt, (zB. via vue-cli), importiere Vue sowie VueRouter und rufe Vue.use(VueRouter) auf.

// 1. Definiere die Route-Komponenenten
// Diese k√∂nnen auch aus anderen Dateien importiert werden.
const Foo = { template: 'foo' }
const Bar = { template: 'bar' }

// 2. Definiere ein paar Routes
// Jede Route sollte mit einer Komponenente verbunden sein.
// Die Komponenente kann entweder eine tats√§chliche Komponente sein, die via Vue.extend() erstellt wird,
// ein Komponenten-ID-String der via Vue.component() registriert wurde,
// oder lediglich ein Optionsobjekt der Komponenente.
// Hinweis: Verschachtelte (engl: "nested") Routes werden sp√§ter in dieser Anleitung behandelt.

const routes = [
  { path: '/foo', component: Foo },
  { path: '/bar', component: Bar }
]

// 3. Erstelle die Router-Instanz und f√ºge ihr die `routes`-Option hinzu.
// Es gibt nt√ºrlich noch mehr Optionen, aber hier halten wir es erstmal einfach.

const router = new VueRouter({
  routes // kurz f√ºr 'routes: routes'
})

// 4. Ertelle und mounte die Root-Instanz.
// Stelle sicher, dass der Router mit der `router` option an die Root Instanz √ºbergeben wird, damit er sp√§ter √ºberall in deiner App zur Verf√ºgung steht.

const app = new Vue({
  router
}).$mount('#app')

// Die App ist nun gestartet.
Das ganze gibt es nat√ºrlich auch als Live-Beispiel an.Hinweis:  erh√§lt automatisch die CSS-class .router-link-active, wenn die aktuelle Route im Browser der des router-link entspricht. Mehr Infos dazu in der API-Referenz.

essentials/dynamic-matching.html.body:
Dynamisches Route-MatchingH√§ufig m√ºssen wir URLs, die einem bestimmten Muster entsprechen, einer Route bzw. Komponente zuordnen. Zum Beispiel haben wir eine User-Komponente, welche f√ºr alle User mit unterschiedlichen IDs gerendert werden soll. In vue-router k√∂nnen wir hierf√ºr ein dynamisches Segment im Pfad nutzen:const User = {
  template: 'User'
}

const router = new VueRouter({
  routes: [
    // dynamische Segmente beginnen mit Doppelpunkt
    { path: '/user/:id', component: User }
  ]
})
Nun werden URLs wie /user/foo und /user/bar der gleichen Route und damit der gleichen Komponente zugeordnet.Ein dynamisches Segment wird mit einem Doppelpunkt : gekennzeichnet. Wenn eine Route mit einem dynamischen Segment erkannt wird, kann man √ºber this.$route.params  in jeder Komponente auf die Werte der dynamischen Segmente zugreifen. So k√∂nnen wir zum Beispiel die aktuelle User-ID rendern, indem wir das User-Template folgenderma√üen erweitern:const User = {
  template: 'User {{ $route.params.id }}'
}
Ein interactives Beispiel ist hier zu finden.Mehrere dynamische Segmente in der gleichen Route sind m√∂glich und werden den entsprechenden Feldern in $route.params zugeordnet. Beispiele:

Muster
passender Pfad
$route.params

/user/:username
/user/evan
{ username: 'evan' }
/user/:username/post/:post_id
/user/evan/post/123
{ username: 'evan', post_id: 123 }


Neben $route.params bietet das $route-Objekt Zugriff auf weitere n√ºtzliche Informationen wie $route.query (sofern eine Query in der URL vorhanden ist). Du findest alle Details dazu in der API Referenz.Reagieren auf √Ñnderungen von "Params"Bei der Nutzung von Parametern in Routes ist zu beachten, dass die selbe Komponenteninstanz genutzt wird, wenn der Nutzer von /user/foo nach /user/bar navigiert. Da beide Routes die gleiche Komponente rendern, ist das effizienter als die alte zu zerst√∂ren und eine neue zu erstellen. Allerdings bedeutet das auch, dass die "lifecycle hooks" der Komponente nicht aufgerufen werden.Um nun auf √Ñnderungen der Params in der gleichen Komponente zu reagieren, kann man einfach das $route-Objekt mit einer watch-function beobachten:const User = {
  template: '...',
  watch: {
    '$route' (to, from) {
      // reagiere auf @Route-√Ñnderungen
    }
  }
}
Erweiterte Matchingsmustervue-router nutzt path-to-regexp f√ºr das Matching der URL-Pfade, und unterst√ºtzt damit viele erweiterte Matching-Muster wie optionale dynamische Segmente, "null oder mehr" / "ein oder mehr" Bedingungen und sogar benutzerdefinierte RegEx-Muster.
An dieser Stelle sei f√ºr weitere Informationen zur Nutzung dieser Features auf die Dokumentation f√ºr erweiterte Muster und dieses Beispiel verwiesen.Matching Priorit√§tManchmal passt die URL zu mehr als einer Route. In diesem Fall ist die Priorit√§t durch die Anordnung der Routes definiert: Je fr√ºher eine Route definiert ist, desto h√∂her ihre Priorit√§t.

essentials/nested-routes.html.body:
Verschachtelte RoutesEchte App-UIs bestehen normalerweise aus Komponenten, die mehrere Ebenen tief verschachtelt sind. Und es ist durchaus √ºblich, dass die Segmente der URL die Struktur der Verschachtelung wiederspiegeln, zum Beispiel so:/user/foo/profile                     /user/foo/posts
+------------------+                  +-----------------+
| User             |                  | User            |
| +--------------+ |                  | +-------------+ |
| | Profile      | |  +------------>  | | Posts       | |
| |              | |                  | |             | |
| +--------------+ |                  | +-------------+ |
+------------------+                  +-----------------+
Mit vue-router k√∂nnen wir derartige Beziehungen sehr leicht mit einer verschachtelten (englisch: "nested") Route-Konfiguration abbilden.Wir bauen auf der App auf, die im letzten Kapitel erstellt wurde:


const User = {
  template: 'User {{ $route.params.id }}'
}

const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User }
  ]
})
Die router-view Komponente ist das Outlet der obersten Ebene. Sie rendert die Komponenten, welche zu Routes der obersten Ebene geh√∂ren. Eine dort gerenderte Komponente kann selbst wiederum eine router-view Komponente enthalten. Wenn wir zum Beispiel eine router-view Komponente im Template der User-Komponente platzieren, sieht das so aus:const User = {
  template: `

      User {{ $route.params.id }}


  `
}
Um Komponenten in diesem verschachtelten Outlet zu rendern, m√ºssen wir die children-Option in der Konfiguration des VueRouter-Konstruktors verwenden.const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User,
      children: [
        {
          // UserProfile wird innerhalb der
          //  von User gerendert,
          // wenn '/user/:id/profile' gematched wird.
          path: 'profile',
          component: UserProfile
        },
        {
          // UserPosts wird innerhalb der
          //  von User gerendert,
          // wenn '/user/:id/posts' gematched wird.
          path: 'posts',
          component: UserPosts
        }
      ]
    }
  ]
})
Hinweis: Verschachtelte Pfade, die mit / starten, werden als "root-path" (zu deutsch: "Wurzel-Pfad") behandelt. Damit kann man eine verschachtelte Route mit einem direkten Pfad erreichen, ohne dass die verschachtelten Pfadsegmente der √ºbergeordneten Routes enthalten sein m√ºssen.Wie du sieht, ist die children-Option nur eine weiteres Array mit Route-Konfigurationsobjekten - wie das routes-Array selbst. Daher k√∂nnen wir Views so oft ineinander verschachteln, wie wir m√∂chten.Wenn du nun aber mit mit der aktuellen Konfiguration /user/foo aufrufst, wird nichts im router-view Outlet von User gerendert, da keine Sub-Route gematched wurde. Wollen wir in dem Fall dennoch eine Komponente rendern, erreichen wir das ganz einfach mit einer Route im children-Array, die einen leeren String als Pfad hat:const router = new VueRouter({
  routes: [
    {
      path: '/user/:id', component: User,
      children: [
        // UserHome wird in 
        // von User gerendert,
        // wenn /user/:id zutrifft.
        { path: '', component: UserHome },

        // ...weitere Sub-Routes
      ]
    }
  ]
})
Eine Demo dazu findest du hier

essentials/named-routes.html.body:
Benannte RoutesManchmal ist es einfacher einer Route mit einem Namen anzusprechen, besonders bei Links zu einer Route oder dem Ausf√ºhren von Navigationen. Den Namen vergibt man beim Erzeugen der Router-Instanz in den routes-Optionen:const router = new VueRouter({
  routes: [
    {
      path: '/user/:userId',
      name: 'user',
      component: User
    }
  ]
})
Um mit router-link zu einer benannten Route zu verlinken, gibt man ein Objekt in die to-Prop ein:User
Dass exakt gleiche Objekt kann auch programmatisch in router.push() genutzt werden.router.push({ name: 'user', params: { userId: 123 }})
In beiden F√§llen wird der Router zum Pfad /user/123 navigieren.Vollst√§ndiges Beispiel hier.

essentials/named-views.html.body:
Benannte ViewsManchmal muss man mehrere Views zur selben Zeit darstellen, anstatt sie zu verschachteln, zum Beispiel bei einem Layout mit Hauptteil und Seitenleiste. Hier sind benannte Views n√ºtzlich. Anstelle eines einzigen Outlets f√ºr die View-Darstellung gibt es mehrere, die Namen tragen k√∂nnen. Ein router-view ohne Namen hei√üt standardm√§√üig default.


Ein View wird durch eine Komponente gerendert, deswegen ben√∂tigen mehrere Views auch mehrere Komponenten f√ºr dieselbe Route. Dabei ist es wichtig components (Plural) in den Optionen zu verwenden:const router = new VueRouter({
  routes: [
    {
      path: '/',
      components: {
        default: Foo,
        a: Bar,
        b: Baz
      }
    }
  ]
})
