essentials/history-mode.html.body:
HTML5-Verlaufsmodus ("History Mode")Der Standardmodus f√ºr vue-router ist der Hash-Modus. Er nutzt den URL-Hash, um eine komplette URL zu simulieren, damit die Seite nicht neu geladen wird, wenn sich die URL √§ndert.Um ohne Hash zu arbeiten, nutzt man den Verlaufsmodus, welcher die history.pushState-API von HTML5 nutzt, um URL-Navigation ohne Reload zu erreichen:const router = new VueRouter({
  mode: 'history',
  routes: [...]
})
Bei Nutzung des Verlaufsmodus sieht die URL "normal" aus, zB. http://meine-seite.de/benutzer/id - Wundersch√∂n!Es gibt jedoch ein Problem: Da unsere App eine sogenannten "Single Page Application (SPA)"
 die komplett im Browser l√§uft, erh√§lt der Nutzer einen 404-Fehler, wenn er http://meine-seite.de/benutzer/id direkt aufruft - denn unter diesem Pfad wird dein Webserver nichts finden.Aber keine Sorge: Um dieses Problem zu beheben, musst du nur eine einzige "catch-all"-Route in deiner Serverkonfiguration erg√§nzen. Wenn die URL zu keiner statischen Datei geh√∂rt, sollte diese Route immer die index.html an den Browser senden, in der deine App l√§uft ist.Beispiel einer ServerkonfigurationApache
  RewriteEngine On
  RewriteBase /
  RewriteRule ^index\.html$ - [L]
  RewriteCond %{REQUEST_FILENAME} !-f
  RewriteCond %{REQUEST_FILENAME} !-d
  RewriteRule . /index.html [L]

nginxlocation / {
  try_files $uri $uri/ /index.html;
}
Node.js (Express)F√ºr Node.js/Express benutz du am besten connect-history-api-fallback middleware.WarnungEs gibt einen kleinen Nachteil: Der Server wird  keine 404-Fehler mehr melden, da alle nicht gefundenen Pfade zur index.html f√ºhren. Um das zu beheben, solltest du eine Sammel-Route in der Vue-App f√ºr die 404-Seite definieren.const router = new VueRouter({
  mode: 'history',
  routes: [
    { path: '*', component: NotFoundComponent }
  ]
})
Alternativ kann man bei einem Node.js-Server den Fallback nutzen, indem man das serverseitige Router-System den 404-Fehler ausgeben l√§sst, sollte die URL auf keine Route treffen, die deine Vue-App kennt.

advanced/navigation-guards.html.body:
Navigation Guards ("Navigations-W√§chter")Wie der Name schon andeutet, werden "navigation guards" vue-router prim√§r genutzt, um Navigationen zu "bewachen", indem diese bei Bedarf redirected oder abgebrochen werden. Es gibt dabei verschiedene M√∂glichkeiten, sich in den Navigationsprozess einzuklinken: global, in der Route Definition oder direkt in der Komponente.Hinweis: Guards werden nicht ausgel√∂st, wenn du Params oder Querys √§nderst. Beobachte in diesen F√§llen einfach das $route-Objekt, um auf √Ñnderungen zu reagieren.Globale GuardsMan kann globale Before-Guards ("davor-guards") mit router.beforeEach registrieren:const router = new VueRouter({ ... })

router.beforeEach((to, from, next) => {
  // ...
})
Globale Before-Guards werden in der Reihenfolge aufgerufen, in der du sie registriert hast, wann immer eine Navigation ausgel√∂st wird. Der guard lann auch auch asynchron beendet werden, und die Navigation ist solange im Status pending, bis alle bearbeitet wurden.Jede Guard Funktion erh√§lt drei Argumente:to: Route: das Route-Objekt, zu dem navigiert wird
from: Route: die aktuelle Route, von der wegnavigiert wird
next: Function: Diese Funktion muss aufgerufen werden, um den guard zu beenden. Die daraus resultierende Aktion h√§ngt von den Argumenten in next ab:next(): Gehe zum n√§chsten guard in der Reihe. Wenn keine mehr vorhanden sind, ist die Navigation best√§tigt.
next(false): Brich die aktuelle Navigation ab. Wurde die URL ge√§ndert (entweder manuell durch den Nutzer oder √ºber den Zur√ºck-Button), wird sie zur√ºckgesetzt auf die der from-Route.
next('/') or next({ path: '/' }): Umleitung zu einer anderen Route. Die aktuelle Navigation wird abgebrochen und eine neue gestartet.

Die next-Funktion muss immer aufgerufen werden, sonst kann der Guard nicht aufgel√∂st werden.Man kann auch globale After-Guards ("Danach-Guards") registrieren, allerdings erhalten diese keine next-Funktion wie der Navigationsschutz und beeinflussen nicht die Navigation selbst:router.afterEach((to, from) => {
  // ...
})
Guards in der RouteMan kann den beforeEnter-Guard direkt in der Router-Konfiguration definieren:const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      beforeEnter: (to, from, next) => {
        // ...
      }
    }
  ]
})
Diese Guards haben die exakt gleiche Signatur wie globale Before-Guards.Guards in KomponentenZu guter Letzt kann man Guards auch direkt in den Route-Komponenten (die, die der Router-Konfiguration hinzugef√ºgt werden) mit beforeRouteEnter und beforeRouteLeave definieren:const Foo = {
  template: `...`,
  beforeRouteEnter (to, from, next) {
    // Wird aufgerufen bevor die Route best√§tigt wird, die diese Komponenten rendert.
    // Hat keinen Zugriff auf den `this`-Kontext der Komponenteninstanz,
    // da diese noch nicht erstellt wurde, wenn die Guard-Funktion aufgerufen wird.
  },
  beforeRouteLeave (to, from, next) {
    // Wird aufgerufen, wenn von der Route, die diese Komponente rendert, wegnavigiert wird.
    // Hat Zugriff zum `this`-Kontext.
  }
}
Der beforeRouteEnter-Guard hat keinen Zugriff auf den this-Kontext, weil der Guard aufgerufen wird, bevor die Navigation best√§tigt wurde, weshalb die Komponente noch gar nicht erzeugt wurde.Allerdings bekommt man Zugriff auf die Instanz, indem man einen Callback an next √ºbergibt. Der Callback wird ausgef√ºhrt wenn die Navigation best√§tigt wurde. Die Komponente wird im Callback als Argument √ºbergeben:beforeRouteEnter (to, from, next) {
  next(vm => {
    // Zugriff auf Komponenteninstanz via 'vm'
  })
}
In beforeRouteLeave-Guards kann man den this-Kontext aufrufen. Dieser Guard wird normalerweise verwendet um zu verhindern, dass ein Benutzer die Route versehentlich verl√§sst ohne ungesicherten Arbeit zu speichern. Die Navigation kann mit next(false) abgebrochen werden.

