Und wie greifen wir auf das meta-Feld zu?Zun√§chst einmal: Wir nennen jedes Route-Objekt in der routes-Konfiguration Route-Record. Route-Records k√∂nnen verschachtelt sein, weshalb eine URL potentiell zu mehreren Route-Records passen kann.Zum Beispiel werden mit der obigen Konfiguration und der URL /foo/bar beide - Parent-Record und Child-Record - gematched.Alle Route-Records, die auf eine URL zutreffen, sind im $route-Objekt und in den Route-Objekten in Navigation-Guards im $route.matched-Array zu finden. Deswegen m√ºssen wir mit einer Schleife das $route.matched Array durchlaufen, um alle Route-Records auf Metafelder zu pr√ºfen.Ein Anwendungsfall ist die Pr√ºfung nach einem Metafeld im globalen Before-Guard:router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.requiresAuth)) {
