advanced/data-fetching.html.body:
Daten ladenOftmals M√ºssen wir Daten von einem Server laden, sobald eine Route aktiviert wird. Zum Beispiel m√ºssen die Daten des Users vom Server geladen werden, bevor das Userprofil angezeigt werden kann. Dies kann auf zwei Arten erreicht werden:Laden nach der Navigation: Der Router schlie√üt zuerst die Navigation ab und wir laden die Daten anschlie√üend in der neuen Komponente. W√§hrend der √úbertragung kann ein Ladebalken oder √§hnliches angezeigt in der Komponente werden.
Laden der Navigation: Wir laden Daten bevor die Navigation der Route durchgef√ºhrt wird und navigieren danach erst zur neuen Route.
Technisch gesehen sind beide Optionen gleich "gut" - letztendlich h√§ngt es davon ab, welche Benutzererfahrung man erreichen m√∂chte.Laden nach der NavigationIn diesem Fall navigieren und rendern wir die neue Komponente direkt und laden die Daten im created-Hook der Komponente. Das erm√∂glicht es uns dem Nutzer in der neuen Komponente einen Ladebalken oder √§hnliches anzuzeigen w√§hrend der Content vom Server geladen wird. Au√üerdem k√∂nnen wir so den Ladevorgang in jeder Komponente individuell gestalten.Im folgenden Beispiel haben wir eine Post-Komponente, welche Daten f√ºr einen Blog-Post basierend auf $route.params.id einholt:


