      {{ error }}



      {{ post.title }}
      {{ post.body }}



export default {
  data () {
    return {
      loading: false,
      post: null,
      error: null
    }
  },
  created () {
    // Lade die Daten, wenn die Komponente erstellt wurde und die
    // Daten bereits observed ("beobachtet") werden.
    this.fetchData()
  },
  watch: {
    // Rufe die Methode erneut auf, wenn sich die Route √§ndert.
    '$route': 'fetchData'
  },
  methods: {
    fetchData () {
      this.error = this.post = null
      this.loading = true
      // Ersetze 'getPost' mit einem beliebigen AJAX-tool / API-Wrapper
      getPost(this.$route.params.id, (err, post) => {
        this.loading = false
        if (err) {
          this.error = err.toString()
        } else {
          this.post = post
        }
      })
    }
  }
}
Laden vor der NavigationIn diesem Fall werden die Daten geladen, bevor wir in die neue Route navigieren. Die Inhalte werden in dem beforeRouteEnter-Guard der neuen Komponente geladen. Die next-Funktion wird erst aufgerufen, wenn der Vorgang abgeschlossen ist:export default {
  data () {
    return {
      post: null,
      error: null
    }
  },
  beforeRouteEnter (to, from, next) {
    getPost(to.params.id, (err, post) => {
      if (err) {
        // Zeige eine globale Fehlermeldung.
        next(false)
      } else {
        next(vm => {
          vm.post = post
        })
      }
    })
  },
  // Wenn die Route ge√§ndert und die Komponente bereits gerendert wurde,
  // ist der Aufbau etwas anders:
  watch: {
    $route () {
      this.post = null
      getPost(this.$route.params.id, (err, post) => {
        if (err) {
          this.error = err.toString()
        } else {
          this.post = post
        }
      })
    }
  }
}
Der Nutzer bleibt im aktuellen View, w√§hrend die Daten f√ºr den neuen View geladen werden. Daher ist es empfehlenswert, derwiel anderswo in der App einen Ladebalken oder √§hnliches anzuzeigen. Wenn der Ladevorgang fehlschl√§gt, ist es au√üerdem wichtig, eine Fehlermeldung auszugeben.

advanced/scroll-behavior.html.body:
Scroll-VerhaltenOft wollen wir, dass die Seite nach oben scrollt, wenn zu einer neuen Route navigiert wird, oder dass die Scroll-Position von Verlaufseintr√§gen wie beim Neuladen einer Seite beibehalten wird. vue-router erm√∂glichst das und noch mehr - wir k√∂nne das Scroll-Verhalten komplett individualisieren.Merke: Dies funktioniert nur im HTML5-Verlaufsmodus ("history mode").Beim Erzeugen der Router-Instanz f√ºgt man die scrollBehavior-Funktion hinzu:const router = new VueRouter({
  routes: [...],
  scrollBehavior (to, from, savedPosition) {
    // zur√ºckgeben der gew√ºnschten Position
  }
})
Die scrollBehavior-Funktion erh√§lt die Route-Objeke to und from als Argumente. Das dritte Argument savedPosition steht nur zur Verf√ºgung, wenn es sich um eine popstate-Navigation handelt (d.h. der Vor-/Zur√ºck-Button des Browsers hat die Navigation ausgel√∂st).Die Funktion sollte ein Objekt zur√ºckgeben, dass die Scroll-Position beschreibt. Das Objekt kann folgenderma√üen aussehen:{ x: number, y: number }

{ selector: string }

Wenn ein falsch-artiger (falsy) Wert oder ein leeres Objekt zur√ºckgegeben wird, wird nicht gescrollt.Im folgenden Beispiel scrollt die Seite komplett nach oben:scrollBehavior (to, from, savedPosition) {
  return { x: 0, y: 0 }
}
Wenn die Function das savedPosition-Object zur√ºckgibt, verh√§lt sich die Seite √§hnlich wie bei der Browser selbst bei normalen Websites, wenn mit den Vor-/Zur√ºck-Buttons des Browsers navigiert wird.scrollBehavior (to, from, savedPosition) {
  if (savedPosition) {
    return savedPosition
  } else {
    return { x: 0, y: 0 }
  }
}
Simulation des "Scrolle zum Anchor"-Verhaltens:scrollBehavior (to, from, savedPosition) {
  if (to.hash) {
    return {
      selector: to.hash
    }
  }
}
