advanced/lazy-loading.html.body:
Lazy LoadingWenn Apps mit einem Bundler erstellt werden, kann das erzeugte "Bundle" recht gro√ü werden und so die Seitenladezeit beeintr√§chtigen. Es w√§re effizienter, wenn man das Bundle in die einzelnen  Router-Komponenten aufteilen k√∂nnte und sie nur dann l√§dt, wenn die Route besucht wird.Mit der Kombination von Vue's Feature f√ºr asynchrone Komponenten und Webpack's Feature "Code-Splitting" (engl. to split: teilen) ist es einfach, dieses "Lazy Loading" genannte Verhalten f√ºr Route-Komponenten zu erreichen.Dazu m√ºssen wir nur unsere Route-Komponenten als asynchrone Komponente definieren:const Foo = resolve => {
  // require.ensure ist Webpacks speziale Syntax f√ºr Code-Splitting.
  require.ensure(['./Foo.vue'], () => {
    resolve(require('./Foo.vue'))
  })
}
Es gibt auch eine alternative Code-Splitting Syntax mit require im AMD-Stil, mit der das ganze Folgenderma√üen vereinfacht werden kann:const Foo = resolve => require(['./Foo.vue'], resolve)
In der Route-Konfiguration muss nichts gen√§ndert werden - wir nutzen Foo wie gewohnt:const router = new VueRouter({
  routes: [
    { path: '/foo', component: Foo }
  ]
})
Gruppierung von Komponenten im selben ChunkManchmal wollen wir alle Komponenten unter der selben Route in den selben ansynchronen Chunk gruppieren. Daf√ºr benutzern wir das "named Chunks" (englisch) Feature, indem wir einen Chunk-Namen als drittes Argument f√ºr require.ensure hinzugef√ºgen.const Foo = r => require.ensure([], () => r(require('./Foo.vue')), 'group-foo')
const Bar = r => require.ensure([], () => r(require('./Bar.vue')), 'group-foo')
const Baz = r => require.ensure([], () => r(require('./Baz.vue')), 'group-foo')
Webpack b√ºndelt alle asynchronen Module mit dem gleichen Chunk-Namen in denselben asynchronen Chunk. Das bedeutet auch, dass keine Dependencies mehr f√ºr require.ensure explizit aufgelistet werden m√ºssen - daher der leere Array als Argument.

