Das Route-ObjektDas Route-Objekt repr√§sentiert den Zustand der aktuell aktiven Route. Es enth√§lt geparste Informationen zur aktuellen URL und den Route-Eintr√§gen, die mit der URL gematched wurden.Das Route-Objekt ist 'immutable' (unver√§nderbar). Jede erfolgreiche Navigation resultiert in einem neuen Route-Objekt.Das Route-Objekt kann an mehreren Orten gefunden werden:in Komponenten als this.$route
