Eigenschaften des Router-Objekts$route.pathTyp: stringEin String, der gleich dem Pfad der aktuellen Route ist immer als absoluter Pfad ausgegeben wird, zB. "/foo/bar".

$route.paramsTyp: ObjectEin Objekt, welches Schl√ºssel/Wert-Paare von Stern- und dynamischen Segmenten enth√§lt. Gibt es keine Parameter, ist der Wert ein leeres Objekt.

$route.queryTyp: ObjectEin Objekt, welches Schl√ºssel/Wert-Paare des Query-Strings enth√§lt. F√ºr den Pfad /foo?user=1 erh√§lt man zum Beispiel $route.query.user == 1. Gibt es keine Query, ist der Wert ein leeres Objekt.

$route.hashTyp: stringDer Hash der aktuellen Route (mit #). Gibt es keinen Hash, ist dessen Wert ein leerer String.

$route.fullPathTyp: stringDie voll umgewandelte URL inklusive Abfrage und Hash.

$route.matchedTyp: Array

Ein Array von Route-Eintr√§gen f√ºr alle verschachtelten Pfadsegmente der aktuellen Route. Route-Eintr√§ge sind Kopien der Objekte im Array der routes-Konfiguration (und deren children-Arrays):const router = new VueRouter({
  routes: [
    // das folgende Objekt in ein Route-Eintrag
    { path: '/foo', component: Foo,
      children: [
        // das ist auch ein Route-Eintrag
        { path: 'bar', component: Bar }
      ]
    }
  ]
})
Wenn die URL /foo/bar ist, ist $route.matched ein Array, welcher beide geklonten Objekte von Parent nach Child sortiert enth√§lt.
$route.nameDer Name der aktuellen Route, sofern vorhanden. Siehe Benannte Routes.

